import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  fetch("https://pokeapi.co/api/v2/pokemon")
  .then(response => {
    return response.json();
}).then(response => {
    console.log(response);
}).catch(err=>{
    console.log(err);
});
  return (
    <div className="App">
    <button type="button" class="btn btn-secondary">Fetch Pokemon</button>
    </div>
  );
}

export default App;
